//Hides fields in the merchandises/new form depending on whether the Donate or Buy selection is chosen in the dropdown menu.

$(function() {
	$('#merchandise_buttontype').change(function(){
		if( $(this).val()==="Donate") {
			$('.perkField').hide("slow");
		} else {
			$('.perkField').show("slow");
		}
	});
});

//Shows uploader depending on selected filetype
$(function() {
	$('.audioField').hide();
	$('.ebookField').hide();
	$('.documentField').hide();
	$('.graphicField').hide();
	$('.videoField').hide();
	$('#perkFiletype').change(function(){
		$('.uploadLabel').show("slow");
		if( $(this).val()==="blank") {
			$('.audioField').hide();
			$('.ebookField').hide();
			$('.documentField').hide();
			$('.graphicField').hide();
			$('.videoField').hide();
		} else if( $(this).val()==="audio") {
			$('.audioField').show("slow");
			$('.ebookField').hide();
			$('.documentField').hide();
			$('.graphicField').hide();
			$('.videoField').hide();
		} else if( $(this).val()==="ebook") {
			$('.audioField').hide();
			$('.ebookField').show("slow");
			$('.documentField').show("slow");
			$('.graphicField').hide();
			$('.videoField').hide();
		} else if( $(this).val()==="graphic") {
			$('.audioField').hide();
			$('.ebookField').hide();
			$('.documentField').hide();
			$('.graphicField').show("slow");
			$('.videoField').hide();
		} else if( $(this).val()==="video") {
			$('.audioField').hide();
			$('.ebookField').hide();
			$('.documentField').hide();
			$('.graphicField').hide();
			$('.videoField').show("slow");
		}
	});
});
window.onLivestreamLoad = function() {

  // Normalize the various vendor prefixed versions of getUserMedia.
  navigator.getUserMedia = (navigator.getUserMedia ||
                            navigator.webkitGetUserMedia ||
                            navigator.mozGetUserMedia || 
                            navigator.msGetUserMedia);
// Check that the browser supports getUserMedia.
// If it doesn't show an alert, otherwise continue.
  if (navigator.getUserMedia) {
    // Request the camera.
    navigator.getUserMedia(
      // Constraints
      {
        video: true, audio: true 
      },

      // Success Callback
      function(localMediaStream) {
        // Get a reference to the video element on the page.
        var vid = document.getElementById('camera-stream');
        // Create an object URL for the video stream and use this 
        // to set the video source.
        vid.src = window.URL.createObjectURL(localMediaStream);
      },

      // Error Callback
      function(err) {
        // Log the error to the console.
        console.log('The following error occurred when trying to use getUserMedia: ' + err);
      }
    );

  } else {
    alert('Sorry, your browser does not support getUserMedia');
  }

}
