function monthMoreEvents(button){
  $(button).prev().toggle();
  $(button).siblings('.dots').toggle();
  $(button).find('.total').show();
  if($(button).text()=='More Conversations'){
    $(button).text('Less Conversations');
  } else {
    $(button).text('More Conversations');
  }
}
